      out.write("				<li><a class=\"counting\">AdoptOpenJDK</a> 'C''N': LTS 8, 11 버전 및 최신 버전 제공, 17 이후는 아래 Adoptium 에서 이관하여 Temurin 이라는 배포 명칭으로 제공</li>\r\n");
      out.write("				<li><a class=\"counting\">JBRT</a>: JetBrains 에서 내부적으로 JDK 사용하여 IDE 개발 후, 런타임만 IDE에 포함하여 제공. 공개 제공하지 않는다.</li>\r\n");
      out.write("				<li><a class=\"counting\">Microsoft JDK</a> 'C''T''N': LTS 11, 17 제공, 주로 자사 Azure 클라우드 환경을 위한 JDK로 제공</li>\r\n");
      out.write("				<li><a class=\"counting\">BellSoft Liberica JDK</a> 'C''T': Spring 에서 공식 런타임으로 지정한 JDK 로 상기 Zulu 처럼 상업적으로도 무료로 사용 가능하며 기술지원을 유료로 제공한다.</li>\r\n");
      out.write("				<li><a class=\"counting\">IBM Semeru Runtime</a> 'T': IBM에서 개발한 JDK로 IBM 클라우드 전용으로 제공한다.</li>\r\n");
      out.write("				<li><a class=\"counting\">Amazon Corretto</a> 'C''T': 오라클의 라이선스 정책 변경으로 태어난, AWS 에서 사용하기 적합한 JDK로, <br>\r\n");
      out.write("				다른 클라우드와 마찬가지로 클라우드의 JDK 사용 시 라이선스 저촉이 우려되어 이렇게 대형 클라우드사에서 JDK를 배포하고 있다.</li>\r\n");
      out.write("				<li><a class=\"counting\">Alibaba Dragonwell</a> 'T': 알리바바가 만든 JDK로, 알리바바는 생각보다 OpenJDK 기여율이 높은 것으로 알려져 있다.<br> \r\n");
      out.write("				그렇다 보니 중국에서는 이 JDK 를 통한 자바 개발을 독려 중. 그런 이유가 아니라면 선택지가 많으므로 <br>\r\n");
      out.write("				중국 내 자바 개발 외에는 쓰지 않는 것을 추천한다.</li>\r\n");
      out.write("				<li><a class=\"counting\">SapMachine</a> 'T': SAP 에서 만든 JDK로, 완전히 SAP 전용이다. 따라서 SAP 개발이 아니라면 볼 일이 없다.</li>\r\n");
      out.write("				<li><a class=\"counting\">Red Hat OpenJDK</a> 'T': 레드햇에서 만든 JDK로, 레드햇 리눅스 및 그 기반인 CentOS 에서도 <br>\r\n");
      out.write("				구동되어 국내에서도 알게모르게 OpenJDK 설치 시 많이 쓰는 JDK다. 즉, CentOS나 레드햇에서 OpenJDK 를 설치하려고 <br>\r\n");
      out.write("				검색하면 십중팔구 이게 검색되어 설치할 JDK인 셈. 레드햇 기반 리눅스 외에서는 동작하지 않는다. 단, <br>\r\n");
      out.write("				공식 사이트에서 Windows 버전을 추가 제공한다.</li>\r\n");
      out.write("				<li><a class=\"counting\">GraalVMCT</a> '$''N': 현재 오라클 에서 적극적으로 밀고 있는 JDK로 자바 뿐만 아니라 CLR 같은 방식으로 <br>\r\n");
      out.write("				자바스크립트 등의 폴리글랏 언어로 개발하여 네이티브에 구동할 수 있도록 개발 환경을 제공하는 목표를 가지고 나온 가상 머신. <br>\r\n");
      out.write("				커뮤니티 참여도도 높아서 기대 중이지만, 아직 실제 운영 사례가 존재하지 않고, 자바 생태계에서 이 VM에서 돌아가는 <br>\r\n");
      out.write("				자바 프레임워크 및 라이브러리도 많지 않아 지켜봐야 하는 VM 이지만 지켜볼 가치는 있다. 무료 커뮤니티 에디션은 상용 사용 가능하며, <br>\r\n");
