      out.write("			\r\n");
      out.write("			</ol>\r\n");
      out.write("			<h2 class=\"h2_tit\">JVM 언어</h2>\r\n");
      out.write("			<p class=\"mb15\"> 이외에 Java와 똑같이 Java 바이트 코드를 생성하지만 언어 규격이 다른 Scala와 Clojure라는 언어들도 있다.<br> \r\n");
      out.write("			Scala는 'Scalable Language'에서 따왔는데, Java와 비슷한 부분이 많으며 Java API를 그대로 가져다 쓸 수도 있다. 또한, <br>\r\n");
      out.write("			syntactic sugar가 많고 함수형 프로그래밍의 여러 가지 요소들을 가져와서 Java에 비해 생산성도 높다. <br>\r\n");
      out.write("			일례로 일일이 타입을 명시하지 않고 var x === 1.5와 같이 넣으면 알아서 float 형으로 추론해준다. 또, <br>\r\n");
      out.write("			switch-case의 확장판이라 할 수 있는 패턴 매칭을 지원하며 클로저도 지원된다. <br>\r\n");
      out.write("			단점으로는 이런 고수준-고생산성의 언어에서 많이 볼 수 있듯이 같은 Java 코드에 비해 약간 느리다. <br>\r\n");
      out.write("			Clojure는 Java 플랫폼에서 동작하는 LISP의 방언으로 설계되었으며 Common Lisp와 Scheme과 함께 주요 LISP 방언 중 하나로 꼽힌다. <br>\r\n");
      out.write("			이 언어도 마찬가지로 Java API를 가져다 쓸 수 있다. </p>\r\n");
      out.write("			<div class=\"wrap_freeline\">\r\n");
      out.write("				<dl class=\"private_info\">\r\n");
      out.write("					<dt class=\"bold\">☞ 유명한 JVM 언어 목록 </dt>\r\n");
      out.write("					<dd>\r\n");
      out.write("					<li><a class=\"counting\">Clojure</a></li>\r\n");
      out.write("					<li><a class=\"counting\">Groovy</a>: Java에 Python, Ruby, SmallTalk 등의 특징을 버무린 동적 타입 언어. 2003년에 등장했다.<br>\r\n");
      out.write("					Gradle 패키지 관리의 기본 언어이다.</li>\r\n");
      out.write("					<li><a class=\"counting\">JRuby</a>: Ruby의 대부분을 Java로 구현한 언어 구현체. 역시 Java와 호환된다.</li>\r\n");
      out.write("					<li><a class=\"counting\">Jython</a>: 파이썬의 Java 구현체. JVM 위에서 동작하며, 따라서 Python 모듈과 함께 Java 클래스, JAR 사용이 가능하다. <br>\r\n");
      out.write("					참고로 로고는 Java의 커피 컨셉과 Python의 뱀 컨셉을 섞어서 커피잔에서 뱀이 연기처럼 피어나오는 로고다(...)</li>\r\n");
      out.write("					<li><a class=\"counting\">Kotlin</a> : IntelliJ IDEA를 만든 JetBrains에서 개발한 JVM 언어. Google I/O 2017에서 안드로이드의 공식 언어로 지정되었다.[8]</li>\r\n");
      out.write("					<li><a class=\"counting\">Rhino</a>: JVM으로 돌아가는 JavaScript 엔진으로, 모질라 재단이 100% Java로 개발했다. <br>\r\n");
      out.write("					JavaScript와 Java의 API를 동시에 사용해 개발할 수 있다. Java 7 에 내장되어 있다.</li>\r\n");
