      out.write("					그러나 Java 11 부터 제거 예정이며, Java 15에서 완전히 제거되었다. 참고로 Nashorn 은 Rhino(코뿔소)의 독일어다. <br>\r\n");
      out.write("					제거 이후는 GraalVM이 대신한다.</li>\r\n");
